import React from "react";
import "../App.css";

const ContactUs = () => {
  return (
    <>
      <img
        className="HomeLogo"
        src={require("./몰입캠프_검정.png").default}
        style={{ height: "100vh" }}
      />
    </>
  );
};

export default ContactUs;
